import React from"react";


const Login = () => (
  <nav className="login">
    <h2> Login here</h2>
    <p>sign in wti manage streo inventory</p>
    <button className="github"
	    onClick={() => this.props.authentication("Github")}>
      Login with github
    </button>
    <button className="google"
	    onClick={() => this.props.authentication("Google")}>
      Login with Google
    </button>
  </nav>
);

export default Login;
